            </a>
          </li>
          <li class="nav-item">
            <a class="nav-link" routerLink="/home/appointment">  <i class="uil uil-hospital"></i> Appointment</a>
          </li>
          <li class="nav-item">
            <a class="nav-link" routerLink="/home/doctor"> <i class="uil uil-user-md"></i> Doctor</a>
